<script src="https://code.jquery.com/jquery-3.7.0.min.js"></script>
<script>
	$(document).ready(function()
	{
		document.body.style.overflow = "hidden";
		$('#Sprawd_List').on("click", function(e){ e.preventDefault(); $('.element').toggleClass('d-none'); })
		$('#Icon_ionic-ios-arrow-back').on("click", function(e){ e.preventDefault(); $('.element').toggleClass('d-none'); })
		

		function wydStrone() 
		{
			var aktWys = document.documentElement.scrollHeight;
			var nowaWys = aktWys + 0;
			document.documentElement.style.height = nowaWys + "px";
			document.body.style.overflow = "visible";
		}

		function send(elem){
			$('.btn-success').prop('disabled', true);
			$.ajax({
				url: "engine.php",
				data: $(elem).serializeArray(),
				type: "POST"                    
			}).always(function(data,status,xhr){        
				$('#number').val('');
				$('.btn-success').prop('disabled', false);
				try
				{
					data = JSON.parse(data);
					console.log(data);
					if (typeof data.msg != 'undefined')
					{
						new Notify ({text: data.msg, effect: 'fade', status: 'info', autoclose: true, autotimeout: 3000, type: 1})
					}
					else if (data.length)
					{
						$.each(data, function(i, obj){
							$('.table tbody').append('<tr data-id="'+obj.id+'" ><td>'+obj.number+'</td><td>'+obj.location+'</td><td>'+obj.name+'</td><td>'+obj.count+' Szt.</td></tr>');
						});
						
						wydStrone();
						
					}                               
				}                   
				catch (error) 
				{
					alert("Napotkano błąd");
					console.log(data);
					console.error(error);
				}                                           
			});			
		}

		$('#Wyszukaj_lokalizacj').on("click", function(e){
			e.preventDefault();
			send($('#form_number'));
		});

		$('#form_number').on("submit", function(e){
			e.preventDefault();
			send($(this));
		});
	});

	if (window.history.replaceState)
	{
		window.history.replaceState(null, null, window.location.href); 
	}   
</script>
